import { combineReducers } from "redux";

const typeOfHouseReducer = (houseType = 7, action) => {
  if (action.type === "TYPE_OF_HOUSE" && action.payload === "Small House") {
    return (houseType = 5);
  } else if (
    action.type === "TYPE_OF_HOUSE" &&
    action.payload === "Middle House"
  ) {
    return (houseType = 7);
  } else if (
    action.type === "TYPE_OF_HOUSE" &&
    action.payload === "Big House"
  ) {
    return (houseType = 9);
  }

  return houseType;
};

export default combineReducers({
  typeOfHouse: typeOfHouseReducer
});
